import { useState } from "react";

const Board = (props) => {
  const [totalBoard, setTotalBoard] = useState(null);

  let initialBoard = props.initialBoard;
  let tempBoard = [];
  for (let i = 0; i < initialBoard.size; i++) {
    for (let j = 0; j < initialBoard.size; j++) {
      if (initialBoard.squares[0]) {
        if (
          initialBoard.squares[0].x === i &&
          initialBoard.squares[0].y === j
        ) {
          tempBoard.push(initialBoard.squares[0]);
        } else {
          tempBoard.push({ x: i, y: j, value: "a" });
          initialBoard.squares.shift();
        }
      }

      //        if (props.initialBoard.squares[i])
      //        let thisCell = props.initialBoard.squares['x']['y']
      //      tempBoard = [...tempBoard, { x: i, y: j, value:  }];
    }
  }
  console.log(tempBoard);

  //let tempBoard = props.initialBoard.squares.map(cell => );

  return (
    <>
      <ul>
        {props.initialBoard.squares.map((cell) => (
          <li key={cell.x.toString() + cell.y.toString()}>{cell.value}</li>
        ))}
      </ul>
    </>
  );
};

export default Board;
